import React from 'react';
import logo from './logo.svg';
import './App.css';


export default class App extends React.Component<>{
  constructor(props){
    super(props)
    this.state = {
      email: '',
      password: ''
    }
  }
  render() {
    return(
      <div>
      <h1 onClick={() => this.setState({email: 'TELLO'})}>TESTE</h1>
      <h1>{this.state.email}</h1>
      </div>
    )
  }
}
